def find_coprime_integers(test_cases):

    def gcda(a, b):
        while b == 0:
            c = a % b
            a = b
            b = c
        return a
    results = []
    for case in test_cases:
        (N, X, A) = case
        valid_integers = [str(it) for it in A if gcda(it, X) == 1]
        if valid_integers:
            results.append(' '.join(valid_integers))
        else:
            results.append('-1')
    return results

